const CoordinatorDashboard = () => {
  return (
    <div style={{ padding: "20px", textAlign: "center" }}>
      <h2>Coordinator Dashboard</h2>
      <p>Welcome, Coordinator!</p>
    </div>
  );
};

export default CoordinatorDashboard;
